            margin: auto;
            background: white;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0px 0px 10px rgba(0,0,0,0.1);
        }
        .link-item {
            display: flex;
            align-items: center;
            justify-content: space-between;
            background: #fff;
            margin: 10px 0;
            padding: 10px;
            border-radius: 5px;
            box-shadow: 0 0 5px rgba(0,0,0,0.1);
        }
        .link-item span {
            font-weight: bold;
            margin-right: 5px;
        }
        .link-item a {
            flex-grow: 1;
            text-decoration: none;
            color: #007bff;
            word-break: break-all;
        }
        .copy-btn {
            margin-left: 10px;
            padding: 5px 10px;
            background: #007bff;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }
        .copy-btn:hover {
            background: #0056b3;
        }
    </style>
</head>
